#!/bin/bash

error(){ # Выход при ошибке
	echo -e "ERROR: $@" >&2
	exit 1
}

# Полный путь к сценарию
script="$(
	cd $(dirname $0)
	echo $(pwd)/$(basename $0)
)"

# Определяем каталог с деревом исходных кодов
if [ -d "rt-n56u" ]
then # Если каталог дерева в текущем каталоге
	gitdir="$(
		cd "rt-n56u"
		git rev-parse --show-toplevel 2>/dev/null
	)"
else # Если сценарий запущен изнутри дерева исходников
	gitdir="$(git rev-parse --show-toplevel 2>/dev/null)"
fi
[ -z "$gitdir" ] && gitdir="$( # Если сценарий лежит в дереве исходников
	cd "$(dirname $script)"
	git rev-parse --show-toplevel  2>/dev/null
)"
[ -z "$gitdir" ] && error "Source tree not found.
Put this script into the source tree and try to start again."

# Заходим в trunk
trunkdir="$gitdir/trunk"
cd $trunkdir || error "Path $trunkdir not found"

# Если нужно, дополняем файл конфигурации
echo === Update config file
grep -q CONFIG_FIRMWARE_INCLUDE_INTELLIJ_IDEA_LICENSE_SERVER .config || echo "
### Include Intellij IDEA License Server
CONFIG_FIRMWARE_INCLUDE_INTELLIJ_IDEA_LICENSE_SERVER=y" >>.config
grep -q CONFIG_FIRMWARE_INCLUDE_KMS .config || echo "
### Include KMS emulator
CONFIG_FIRMWARE_INCLUDE_KMS=y" >>.config

echo === Add new files
# Проверяем архив с недостающими файлами на целостность
[ "$(sed '1,/^---- .*/d' "$script" | base64 -d | md5sum)" = "7101fd267f9a816e47f002df8c010d26  -" ] || error Archive corrupted md5 error

# Разворачиваем архив
sed '1,/^---- .*/d' "$script" | base64 -d | tar xvzf - || error Archive corrupted

# Накладываем "заплатку"
echo === Patch files
patch --strip 0 << \EOF
--- user/Makefile
+++ user/Makefile
@@ -148,6 +148,9 @@ endif
 dir_y						+= mtd-utils
 endif

+dir_$(CONFIG_FIRMWARE_INCLUDE_INTELLIJ_IDEA_LICENSE_SERVER) += intellijidea
+dir_$(CONFIG_FIRMWARE_INCLUDE_KMS) += vlmcsd
+
 all:
 	for i in $(dir_y) ; do \
 		[ ! -d $$i ] || \
EOF

exit
